webpackJsonp([30053658046418],{2813:function(e,t){e.exports={pathContext:{docHtml:'<h1>Change Log</h1>\n<p>All notable changes to this project will be documented in this file. See <a href="https://github.com/conventional-changelog/standard-version">standard-version</a> for commit guidelines.</p>\n<p><a name="3.17.1"></a></p>\n<h2><a href="https://github.com/godaddy/kubernetes-client/compare/3.17.0...v3.17.1">3.17.1</a> (2017-11-14)</h2>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>CRDs:</strong> Fix a filename typo (#159) (<a href="https://github.com/godaddy/kubernetes-client/commit/6f880fc">6f880fc</a>), closes <a href="https://github.com/godaddy/kubernetes-client/issues/159">#159</a></li>\n</ul>\n<p><a name="3.17.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.16.1...v3.17.0">3.17.0</a> (2017-11-14)</h1>\n<h3>Features</h3>\n<ul>\n<li><strong>CustomResourceDefinition:</strong> Add support for CRDs (#149) (<a href="https://github.com/godaddy/kubernetes-client/commit/4261c2e">4261c2e</a>)</li>\n</ul>\n<p><a name="3.16.1"></a></p>\n<h2><a href="https://github.com/godaddy/kubernetes-client/compare/3.16.0...v3.16.1">3.16.1</a> (2017-11-08)</h2>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>kubeconfig:</strong> accept relative and absolute paths (#155) (<a href="https://github.com/godaddy/kubernetes-client/commit/3cbf9cf">3cbf9cf</a>)</li>\n</ul>\n<p><a name="3.16.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.14.0...v3.16.0">3.16.0</a> (2017-09-28)</h1>\n<h3>Features</h3>\n<ul>\n<li><strong>Promise API:</strong> Experimental support for a promise-based API (#133) (<a href="https://github.com/godaddy/kubernetes-client/commit/b5f5e10">b5f5e10</a>)</li>\n<li><strong>Send body in DELETE requests:</strong> (#142) (<a href="https://github.com/godaddy/kubernetes-client/commit/10e4018">10e4018</a>)</li>\n</ul>\n<p><a name="3.15.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.14.0...v3.15.0">3.15.0</a> (2017-08-29)</h1>\n<h3>Features</h3>\n<ul>\n<li><strong>Send body in DELETE requests:</strong> (#142) (<a href="https://github.com/godaddy/kubernetes-client/commit/10e4018">10e4018</a>)</li>\n</ul>\n<p><a name="3.14.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.12.0...v3.14.0">3.14.0</a> (2017-08-01)</h1>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>undefined <code>options</code> passed to <code>.get</code>:</strong> set default <code>options</code> value to <code>{}</code> (#115) (<a href="https://github.com/godaddy/kubernetes-client/commit/b2df448">b2df448</a>)</li>\n<li><strong>Update broken unit test:</strong> remove incorrect usage of nock.matchHeader (#114) (<a href="https://github.com/godaddy/kubernetes-client/commit/5469623">5469623</a>)</li>\n</ul>\n<h3>Features</h3>\n<ul>\n<li><strong>Add <code>getStream</code>:</strong> Addition to resource API (#119) (<a href="https://github.com/godaddy/kubernetes-client/commit/6268dde">6268dde</a>)</li>\n<li><strong>Deployment:</strong> Support for deployment under apps (#122) (#122) (<a href="https://github.com/godaddy/kubernetes-client/commit/3688d1e">3688d1e</a>)</li>\n</ul>\n<p><a name="3.13.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.12.0...3.13.0">3.13.0</a> (2017-07-29)</h1>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>undefined <code>options</code> passed to <code>.get</code>:</strong> set default <code>options</code> value to <code>{}</code> (<a href="https://github.com/godaddy/kubernetes-client/issues/115">#115</a>) (<a href="https://github.com/godaddy/kubernetes-client/commit/b2df448">b2df448</a>)</li>\n<li><strong>Update broken unit test:</strong> remove incorrect usage of nock.matchHeader (<a href="https://github.com/godaddy/kubernetes-client/issues/114">#114</a>) (<a href="https://github.com/godaddy/kubernetes-client/commit/5469623">5469623</a>)</li>\n</ul>\n<h3>Features</h3>\n<ul>\n<li><strong>Add <code>getStream</code>:</strong> Addition to resource API (<a href="https://github.com/godaddy/kubernetes-client/issues/119">#119</a>) (<a href="https://github.com/godaddy/kubernetes-client/commit/6268dde">6268dde</a>)</li>\n</ul>\n<p><a name="3.12.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.11.0...v3.12.0">3.12.0</a> (2017-06-15)</h1>\n<h3>Features</h3>\n<ul>\n<li><strong>auth-provider:</strong> support for auth-provider access-token in fromKubeconfig() (#112) (<a href="https://github.com/godaddy/kubernetes-client/commit/9b02bc2">9b02bc2</a>)</li>\n</ul>\n<p><a name="3.11.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.10.1...v3.11.0">3.11.0</a> (2017-05-31)</h1>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>README:</strong> modified group example to be correct (#94) (<a href="https://github.com/godaddy/kubernetes-client/commit/73e4f05">73e4f05</a>)</li>\n</ul>\n<h3>Features</h3>\n<ul>\n<li><strong>Deployment:</strong> Support for additional Deployment operations (#103) (<a href="https://github.com/godaddy/kubernetes-client/commit/d802180">d802180</a>)</li>\n</ul>\n<p><a name="3.10.1"></a></p>\n<h2><a href="https://github.com/godaddy/kubernetes-client/compare/3.10.0...v3.10.1">3.10.1</a> (2017-03-09)</h2>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>matchLabels:</strong> call BaseObject constructor with correct arguments (#91) (<a href="https://github.com/godaddy/kubernetes-client/commit/9e1f2d6">9e1f2d6</a>)</li>\n</ul>\n<p><a name="3.10.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.8.0...v3.10.0">3.10.0</a> (2017-03-03)</h1>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>response <code>content-type</code> checking:</strong> more robust JSON response handling (#89) (<a href="https://github.com/godaddy/kubernetes-client/commit/ace816e">ace816e</a>)</li>\n</ul>\n<h3>Features</h3>\n<ul>\n<li><strong>Support for more APIs:</strong> Apps, Batch, and RBAC (#78) (<a href="https://github.com/godaddy/kubernetes-client/commit/3734e12">3734e12</a>)</li>\n</ul>\n<p><a name="3.9.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.8.0...v3.9.0">3.9.0</a> (2017-02-27)</h1>\n<h3>Features</h3>\n<ul>\n<li><strong>Support for more APIs:</strong> Apps, Batch, and RBAC (#78) (<a href="https://github.com/godaddy/kubernetes-client/commit/3734e12">3734e12</a>)</li>\n</ul>\n<p><a name="3.8.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.5.1...v3.8.0">3.8.0</a> (2017-02-25)</h1>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>config:</strong> switched token from base64 to string (#83) (<a href="https://github.com/godaddy/kubernetes-client/commit/95b75a2">95b75a2</a>)</li>\n<li><strong>getInCluster:</strong> Use ca.crt correctly (#87) (<a href="https://github.com/godaddy/kubernetes-client/commit/3c18ebf">3c18ebf</a>)</li>\n</ul>\n<h3>Features</h3>\n<ul>\n<li><strong>config:</strong> Now accept a manually specified context in fromKubeConfig (#82) (<a href="https://github.com/godaddy/kubernetes-client/commit/12738ef">12738ef</a>)</li>\n</ul>\n<p><a name="3.7.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.4.0...v3.7.0">3.7.0</a> (2017-02-25)</h1>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>config:</strong> switched token from base64 to string (#83) (<a href="https://github.com/godaddy/kubernetes-client/commit/95b75a2">95b75a2</a>)</li>\n</ul>\n<h3>Features</h3>\n<ul>\n<li><strong>config:</strong> Now accept a manually specified context in fromKubeConfig (#82) (<a href="https://github.com/godaddy/kubernetes-client/commit/12738ef">12738ef</a>)</li>\n</ul>\n<p><a name="3.6.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.5.1...v3.6.0">3.6.0</a> (2017-02-24)</h1>\n<h3>Features</h3>\n<ul>\n<li><strong>config:</strong> Now accept a manually specified context in fromKubeConfig (#82) (<a href="https://github.com/godaddy/kubernetes-client/commit/12738ef">12738ef</a>)</li>\n</ul>\n<p><a name="3.5.1"></a></p>\n<h2><a href="https://github.com/godaddy/kubernetes-client/compare/3.5.0...v3.5.1">3.5.1</a> (2017-02-23)</h2>\n<p><a name="3.5.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.3.0...v3.5.0">3.5.0</a> (2017-02-14)</h1>\n<h3>Features</h3>\n<ul>\n<li><strong>config.loadKubeconfig:</strong> helper for loading an API config from ~/.kube/config (#73) (<a href="https://github.com/godaddy/kubernetes-client/commit/3a9b609">3a9b609</a>)</li>\n</ul>\n<p><a name="3.4.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.3.0...v3.4.0">3.4.0</a> (2017-02-13)</h1>\n<h3>Features</h3>\n<ul>\n<li><strong>config.loadKubeconfig:</strong> helper for loading an API config from ~/.kube/config (#73) (<a href="https://github.com/godaddy/kubernetes-client/commit/3a9b609">3a9b609</a>)</li>\n</ul>\n<p><a name="3.3.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.1.0...v3.3.0">3.3.0</a> (2017-02-09)</h1>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>error handling:</strong> handle API errors that aren\'t JSON (#60) (<a href="https://github.com/godaddy/kubernetes-client/commit/f8ae84c">f8ae84c</a>)</li>\n</ul>\n<h3>Features</h3>\n<ul>\n<li><strong>extensions/thirdpartyresources:</strong> Add <code>thirdpartyresources</code> to <code>Extensions</code> (#69) (<a href="https://github.com/godaddy/kubernetes-client/commit/e720491">e720491</a>)</li>\n<li><strong>insecureSkipTlsVerify:</strong> plumb an option to skip verifying server certs (#61) (<a href="https://github.com/godaddy/kubernetes-client/commit/901773e">901773e</a>)</li>\n<li><strong>ThirdPartyResource:</strong> Add <code>resources</code> option to constructor (#71) (<a href="https://github.com/godaddy/kubernetes-client/commit/f457b56">f457b56</a>)</li>\n<li><strong>ThirdPartyResources:</strong> add support for Third Party Resources (#70) (<a href="https://github.com/godaddy/kubernetes-client/commit/58614c5">58614c5</a>), closes <a href="https://github.com/godaddy/kubernetes-client/issues/43">#43</a></li>\n</ul>\n<p><a name="3.2.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.1.0...v3.2.0">3.2.0</a> (2017-01-20)</h1>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>error handling:</strong> handle API errors that aren\'t JSON (#60) (<a href="https://github.com/godaddy/kubernetes-client/commit/f8ae84c">f8ae84c</a>)</li>\n</ul>\n<h3>Features</h3>\n<ul>\n<li><strong>insecureSkipTlsVerify:</strong> plumb an option to skip verifying server certs (#61) (<a href="https://github.com/godaddy/kubernetes-client/commit/901773e">901773e</a>)</li>\n</ul>\n<p><a name="3.1.0"></a></p>\n<h1><a href="https://github.com/godaddy/kubernetes-client/compare/3.0.0...3.1.0">3.1.0</a> (2016-12-24)</h1>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>aliases:</strong> Add missing object aliases (#54) (<a href="https://github.com/godaddy/kubernetes-client/commit/3cf1e3a">3cf1e3a</a>)</li>\n</ul>\n<h3>Features</h3>\n<ul>\n<li><strong>core:</strong> add in-cluster config helper (#49) (<a href="https://github.com/godaddy/kubernetes-client/commit/85915d5">85915d5</a>)</li>\n</ul>',docPath:"argo-ci/node_modules/kubernetes-client/changelog",proj:"argo-ci"}}}});
